collections::btree::set::BTreeSet::<T, A.doc:
Returns the number of elements in the set.

# Examples

```
use std::collections::BTreeSet;

let mut v = BTreeSet::new();
assert_eq!(v.len(), 0);
v.insert(1);
assert_eq!(v.len(), 1);
```

Returns a reference to the first element in the set, if any.
This element is always the minimum of all elements in the set.

# Examples

Basic usage:

```
use std::collections::BTreeSet;

let mut set = BTreeSet::new();
assert_eq!(set.first(), None);
set.insert(1);
assert_eq!(set.first(), Some(&1));
set.insert(2);
assert_eq!(set.first(), Some(&1));
```

Returns a reference to the last element in the set, if any.
This element is always the maximum of all elements in the set.

# Examples

Basic usage:

```
use std::collections::BTreeSet;

let mut set = BTreeSet::new();
assert_eq!(set.last(), None);
set.insert(1);
assert_eq!(set.last(), Some(&1));
set.insert(2);
assert_eq!(set.last(), Some(&2));
```

Gets an iterator that visits the elements in the `BTreeSet` in ascending
order.

# Examples

```
use std::collections::BTreeSet;

let set = BTreeSet::from([3, 1, 2]);
let mut set_iter = set.iter();
assert_eq!(set_iter.next(), Some(&1));
assert_eq!(set_iter.next(), Some(&2));
assert_eq!(set_iter.next(), Some(&3));
assert_eq!(set_iter.next(), None);
```

core::cmp::Ord::cmp.doc:
This method returns an [`Ordering`] between `self` and `other`.

By convention, `self.cmp(&other)` returns the ordering matching the expression
`self <operator> other` if true.

# Examples

```
use std::cmp::Ordering;

assert_eq!(5.cmp(&10), Ordering::Less);
assert_eq!(10.cmp(&5), Ordering::Greater);
assert_eq!(5.cmp(&5), Ordering::Equal);
```

core::iter::Iterator::next.doc:
Advances the iterator and returns the next value.

Returns [`None`] when iteration is finished. Individual iterator
implementations may choose to resume iteration, and so calling `next()`
again may or may not eventually start returning [`Some(Item)`] again at some
point.

[`Some(Item)`]: Some

# Examples

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

// A call to next() returns the next value...
assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());

// ... and then None once it's over.
assert_eq!(None, iter.next());

// More calls may or may not return `None`. Here, they always will.
assert_eq!(None, iter.next());
assert_eq!(None, iter.next());
```

core::iter::DoubleEndedIterator::next_ba.doc:
Removes and returns an element from the end of the iterator.

Returns `None` when there are no more elements.

The [trait-level] docs contain more details.

[trait-level]: DoubleEndedIterator

# Examples

Basic usage:

```
let numbers = vec![1, 2, 3, 4, 5, 6];

let mut iter = numbers.iter();

assert_eq!(Some(&1), iter.next());
assert_eq!(Some(&6), iter.next_back());
assert_eq!(Some(&5), iter.next_back());
assert_eq!(Some(&2), iter.next());
assert_eq!(Some(&3), iter.next());
assert_eq!(Some(&4), iter.next());
assert_eq!(None, iter.next());
assert_eq!(None, iter.next_back());
```

# Remarks

The elements yielded by `DoubleEndedIterator`'s methods may differ from
the ones yielded by [`Iterator`]'s methods:

```
let vec = vec![(1, 'a'), (1, 'b'), (1, 'c'), (2, 'a'), (2, 'b')];
let uniq_by_fst_comp = || {
    let mut seen = std::collections::HashSet::new();
    vec.iter().copied().filter(move |x| seen.insert(x.0))
};

assert_eq!(uniq_by_fst_comp().last(), Some((2, 'a')));
assert_eq!(uniq_by_fst_comp().next_back(), Some((2, 'b')));

assert_eq!(
    uniq_by_fst_comp().fold(vec![], |mut v, x| {v.push(x); v}),
    vec![(1, 'a'), (2, 'a')]
);
assert_eq!(
    uniq_by_fst_comp().rfold(vec![], |mut v, x| {v.push(x); v}),
    vec![(2, 'b'), (1, 'c')]
);
```

core::iter::Iterator::all.doc:
Tests if every element of the iterator matches a predicate.

`all()` takes a closure that returns `true` or `false`. It applies
this closure to each element of the iterator, and if they all return
`true`, then so does `all()`. If any of them return `false`, it
returns `false`.

`all()` is short-circuiting; in other words, it will stop processing
as soon as it finds a `false`, given that no matter what else happens,
the result will also be `false`.

An empty iterator returns `true`.

# Examples

Basic usage:

```
let a = [1, 2, 3];

assert!(a.into_iter().all(|x| x > 0));

assert!(!a.into_iter().all(|x| x > 2));
```

Stopping at the first `false`:

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

assert!(!iter.all(|x| x != 2));

// we can still use `iter`, as there are more elements.
assert_eq!(iter.next(), Some(3));
```

